Gsp9dHuV1To.description:
Автокресло 0-1 Carmate Kurutto High Grade (Кармэйт Курутто Хай Грэйд)
http://lapsi.ru/e-store/xml_catalog/index.php?item=1024

Описание: 
- чаша кресла очень просто поворачивается в любую сторону на 360 градусов; 
- дополнительный упор кресла в пол выполнен не в форме трубки, а имеет П-образную форму; 
- подставка для ног не является дополнительной опцией и предусмотрена конструкцией кресла; 
- под тканевую обивку помещёна подушка Ultra Cushion из специального виброгасящего материала; 
- дышащий сверхтехнологичный материал кресла обеспечит полный комфорт Вашему малышу; 
- обивка легко снимается и стирается; 
- система 5-точечных ремней с централизованной регулировкой длины ремня; 
- три положения угла наклона кресла; 
- тепло и влагоотводящий вкладыш для новорождённого с эффектом «мамины руки» идеально поддерживает тело ребёнка, равномерно распределяя нагрузку и оставляя при этом абсолютно расслабленными все суставы. 

Крепление: 
- штатные ремни безопасности; 
- не важно, какой стороной к тротуару припаркован Ваш автомобиль: конструкция кресла обеспечивает возможность его крепления с любой стороны автомобиля. 

Технические характеристики: 
- внутренние размеры (ВхДхШ): 59x33x19 см; 
- внешние размеры (ВхДхШ): 65x55x62 см; 
- допустимый вес ребёнка: от 2,5 до 18 кг; 
- допустимый рост ребёнка: от 50 до 100 см; 
- вес кресла: 12,8 кг. 

Производитель: Carmate (Япония) 

Подробная информация на сайте http://www.lapsi.ru
